content:
@Jerusalem_Post @netanyahu There is a big difference between Judaism and Zionism: one can be Zionist without practicing Judaism.
But one cannot practice Judaism without being Zionist. This is part and parcel of the religion.
"Next year in Jerusalem" is in the prayers of Passover.

